(1, , 'Star Wars: The Rise of Skywalker', 2019, 142, 'PG-13', 'movie', 'JJ Abrams', NULL, NULL, 'Star Wars: The Rise of Skywalker (also known as Star Wars: Episode IX  The Rise of Skywalker) is a 2019 American epic space-opera film produced, co-written, and directed by J. J. Abrams. It is the third installment of the Star Wars sequel trilogy, following The Force Awakens (2015) and The Last Jedi (2017), and the final episode of the nine-part \"Skywalker saga\".[a] It was produced by Lucasfilm and Abrams\'s production company Bad Robot Productions, and was distributed by Walt Disney Studios Motion Pictures. The ensemble cast includes Carrie Fisher, Mark Hamill, Adam Driver, Daisy Ridley, John Boyega, Oscar Isaac, Anthony Daniels, Naomi Ackie, Domhnall Gleeson, Richard E. Grant, Lupita Nyong\'o, Keri Russell, Joonas Suotamo, Kelly Marie Tran, Ian McDiarmid, and Billy Dee Williams. It features the second posthumous film performance by Fisher, who died in 2016 and appears through the use of unused footage from The Force Awakens.');
INSERT INTO `media` (`mid`, `image`, `title`, `year`, `runtime`, `age_rating`, `type`, `director`, `seasons`, `episodes`, `description`) VALUES
(2, , 'Shrek', 2001, 95, 'PG', 'movie', 'Andrew Adamson', NULL, NULL, 'Shrek is a 2001 American computer-animated comedy film loosely based on the 1990 fairytale picture book of the same name by William Steig. Directed by Andrew Adamson and Vicky Jenson in their directorial debuts, it stars Mike Myers, Eddie Murphy, Cameron Diaz, and John Lithgow as the voices of the lead characters. The film parodies other films adapted from fairy tale storylines, primarily aimed at animated Disney films. In the story, an ogre called Shrek (Myers) finds his swamp overrun by fairy tale creatures who have been banished by the corrupt Lord Farquaad (Lithgow) aspiring to be king. Shrek makes a deal with Farquaad to regain control of his swamp in return for rescuing Princess Fiona (Diaz), whom Farquaad intends to marry. With the help of Donkey (Murphy), Shrek embarks on his quest but soon falls in love with the princess, who is hiding a secret that will change his life forever.');
INSERT INTO `media` (`mid`, `image`, `title`, `year`, `runtime`, `age_rating`, `type`, `director`, `seasons`, `episodes`, `description`) VALUES
(3, , 'The Witcher', 2019, NULL, 'TV-MA', 'tv', 'Alik Sakharov', 1, 8, 'The Witcher is a fantasy drama series created by American showrunner Lauren Schmidt Hissrich for Netflix. It is based on the book series of the same name by Polish writer Andrzej Sapkowski. The first season, consisting of eight episodes, was released in its entirety December 20, 2019. A second season was announced for release in 2021.');
INSERT INTO `media` (`mid`, `image`, `title`, `year`, `runtime`, `age_rating`, `type`, `director`, `seasons`, `episodes`, `description`) VALUES
(4, , 'The Mandalorian', 2019, NULL, 'PG-13', 'tv', NULL, 1, 8, 'The Mandalorian, also known as Star Wars: The Mandalorian, is an American space Western web television series that premiered on Disney+ on November 12, 2019. Set in the Star Wars universe, the series takes place five years after the events of Return of the Jedi and 25 years prior to the events of The Force Awakens and follows the exploits of a Mandalorian bounty hunter beyond the reaches of the New Republic.');

